import { Nav, Container, Row, Col } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';
import { useState } from 'react';

function LoginForm() {
  const [email, setEmail] = useState("");
  const [pass, setPass] = useState("");

  function on_submit(ev) {
    ev.preventDefault();
    api_login(email, pass);
  }

  return (
    <Form onSubmit={on_submit} inline>
      <Form.Control name="email"
                    type="email"
                    placeholder="Enter email"
                    onChange={(ev) => setEmail(ev.target.value)}
                    value={email} />
      <Form.Control name="password"
                    type="password"
                    placeholder="Enter password"
                    onChange={(ev) => setPass(ev.target.value)}
                    value={pass} />
      <Button variant="primary" type="submit">
        Login
      </Button>
    </Form>
  );
}

function Link({to, children}) {
  return (
    <Nav.Item>
      <NavLink to={to} exact
        className="nav-link font-weight-bold text-dark"
        activeClassName="active">
        {children}
      </NavLink>
    </Nav.Item>
  );
}
export default function AppNav() {
  return(
    <div>
      <Row>
      <Nav variant="tabs" defaultActiveKey="/">
        <Link to="/">Wellness</Link>
        <Link to="/lostfound">Lost/Found</Link>
        <Link to="/food">Food Choices</Link>
        <Link to="/selladopt">Sell/Adopt</Link>
        <Link to="/forum">Forum</Link>
      </Nav>
      </Row>
    </div>
  );
}
